menu-settings.editor-item.field.url.desc:
URL is formed by one of ways:
• Absolute URL - value starts with "http://" or "https://", for example http://example.com, opens in a new tab;
• Relative URL - value starts with "/", sample: example.com/<value>;
• Relative URL - value doesn't start with "/", sample: example.com/v2/page<value>;
